import React, { useState, useEffect, useContext } from 'react'
import { NavLink } from "react-router-dom";
import Swal from 'sweetalert2';
import { AdminContext } from "../../App"

const Getrentcars = () => {

    const { adminState, dispatchadmin } = useContext(AdminContext)

    const [getCars, setGetCars] = useState([]);

    const getallrenttcars = async () => {
        try {
            const res = await fetch('/getAvailableRentCars', {
                method: 'GET',
            });

            const data = await res.json();
            setGetCars(data);

        }
        catch (error) {
            console.log(error)
        }
    }

    useEffect(() => {
        getallrenttcars();
    }, [])

    let carIdFromDashBoard;
    const deleteUser = async (e) => {
        carIdFromDashBoard = e.target.id;

        if (!carIdFromDashBoard) {
            // Handle the case where carIdFromDashBoard is empty or undefined
            alert("Invalid car ID. Please try again.");
            return;
        }

        try {
            const response = await fetch("/deleteRentCarFromDashboard", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify({
                    carIdFromDashBoard
                })
            });

            if (response.ok) {
                // Deletion successful
                Swal.fire({
                    icon: 'success',
                    title: 'car Deleted',
                    text: 'car deleted successfully!'
                }).then(() => {
                    window.location.reload();
                });
            } else {
                // Handle any errors here
                throw new Error("User deletion failed.");
            }
        } catch (error) {
            console.log(error);
            // Display an error message if deletion fails
            Swal.fire({
                icon: 'error',
                title: 'Error',
                text: 'User deletion failed. Please try again later.'
            });
        }
    };





    const Loginbutton = () => {

        if (adminState) {
            return <div>
                <button className="logoutbtnDash"><NavLink className="nav-link" to="/adminsignout">logout</NavLink></button>
            </div>
        }
        else {
            return <div>
                <button className="logoutbtnDash"><NavLink className="nav-link" to="/signin">login</NavLink></button>

            </div>
        }
    }


    return (
        <>


            <div className="sidebar">
                <div className="logo-details">
                    <i className=''></i>
                    <span className='logo_name1'>Car</span><span className="logo_name">Rent</span>
                </div>
                <ul className="nav-links">
                    <li>
                        <NavLink className="dashlinks" to="/dashboard">
                            <i className='bx bx-grid-alt' ></i>
                            <span className="allLinks_name">Dashboard</span>
                        </NavLink>
                    </li>
                    <li>
                        <NavLink className="dashlinks" to="/addcars">
                            <i class="fa-sharp fa-solid fa-square-plus"></i>
                            <span className="allLinks_name">Add Cars</span>
                        </NavLink>
                    </li>
                    <li>
                        <NavLink className="dashlinks" to="/getrentcarsforadmin">
                            <i class="fa-sharp fa-solid fa-car"></i>
                            <span className="allLinks_name">Available Rent Cars</span>
                        </NavLink>
                    </li>
                    <li>
                        <NavLink className="dashlinks" to="/rentcarsreports">
                            <i class="fa-solid fa-sack-dollar"></i>
                            <span className="allLinks_name">Rent Cars Income</span>
                        </NavLink>
                    </li>
                    <li>
                        <NavLink className="dashlinks" to="/availableusers">
                            <i class="fa-solid fa-users"></i>
                            <span className="allLinks_name">Available Users</span>
                        </NavLink>
                    </li>
                </ul>

                <div className="logoutbtnDashDiv">
                    <Loginbutton />
                </div>
            </div>

            <section className="home-section">
                <nav>
                    <div className="sidebar-button">

                        <span className="dashboard">Dashboard</span>
                    </div>

                    <div className="profile-details">
                        <span className="admin_name">Admin</span>
                    </div>
                </nav>

                <div className="salecartableDiv">

                    <h1 className="heading"><span>Available Rent Cars</span></h1>

                    <table className="salecartable">
                        <thead>
                            <tr>
                                <th >BRAND </th>
                                <th >MODEL </th>
                                <th >RENT </th>
                                <th >PRICE </th>
                                <th >AVAILABILITY </th>
                                <th >DELETE </th>
                            </tr>
                        </thead>

                        {getCars.map((getCars) =>
                            <tbody key={getCars._id} >
                                <tr>
                                    <td >{getCars.brand}</td>
                                    <td >{getCars.model}</td>
                                    <td >{getCars.rent}</td>
                                    <td >{getCars.price} DA</td>
                                    <td >{getCars.availability} days</td>
                                    <td ><button id={getCars._id} onClick={deleteUser} className="btn">
                                        <i className="fa fa-trash"></i>
                                    </button>
                                    </td>
                                </tr>
                            </tbody>

                        )}
                    </table>
                </div>
            </section>
        </>
    )
}

export default Getrentcars
